import React from 'react';
import Header from '../components/shared/Header';

class Index extends React.Component{
	render(){
		return(
		<div>
		  	<h1>Welcome to Index Page</h1>
		  	<Header />

	  	</div>
	  	)
	}
}
export default Index;
